    // }
    console.log(items);
    for(const [property, value] of Object.entries(props.value[currentIndex])){//Change the one to set to the first element. //MAKE THIS A DROP DOWN TO SELECT WHICH PROPERTIES
        console.log(value);
        valueChangerList.push(
            <ValueChanger sx={{}} key={property} property={property} value={value} keyHistory={[...props.keyHistory, props.property, currentIndex]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
        )
    }

    return(
        
        <Stack spacing={0} sx={{pl: 0,}}>
            <Select value={''} onClick={() => {setCurrentIndex(2)}}>
                {items}
            </Select>
            {valueChangerList}
        </Stack>

    )
}

export default CollapsibleChanger;
